package CoreJava;

public class Arithmetic {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int a=5,b=5;
        int c=10,d=6;
        int e=19,f=7;
        int g=56,h=4;
        int i=256,j=2;
        System.out.println(a+b);
        System.out.println(c-d);
        System.out.println(e*f);
        System.out.println(g/h);  
        System.out.println(i%j);

	}

}
